import './App.css';

function App() {
  return (
    <>
      <nav className="navbar is-transparent" role="navigation" aria-label="main navigation">
        <div className="container">
          <div className="navbar-brand"><a className="navbar-item" href="/"><i className="fak fa-mf-logo has-text-primary fa-4x"></i></a><a className="navbar-burger" role="button" aria-label="menu" aria-expanded="false" data-target="#navMenu"><span aria-hidden="true"></span><span aria-hidden="true"></span><span aria-hidden="true"></span></a></div>
          <div className="navbar-menu is-shadowless" id="navMenu">
            <div className="navbar-start"></div>
            <div className="navbar-end"><a className="navbar-item has-text-weight-normal" href="/mentorship">Mentorship</a>
              <div className="navbar-item"><a className="button is-primary is-outlined is-rounded has-text-weight-normal" href='/contact'>Say Hello </a></div>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}

export default App;
